import React from "react";
import Navbar from "../Navbar";
import Hero from "../Hero";
import Footer from '../footer/Footer'

function contact() {
  return (
    <div>
      <Navbar />
      <Hero
        cName="hero-mid"
        heroImg="/assets/2.jpg"
        title="Contact"
        btnClass="hide"
      />

    <Footer />

    </div>
  );
}

export default contact;
